    false,nt"url": null,nt"notes": "This annual narrative report for National
    Bison Range, Ninepipe National Wildlife Refuge, Pablo National Wildlife Refuge outlines
    Refuge accomplishments during the 1969 calendar year. The report begins by summarizing
    the weather conditions, habitat conditions, water conditions, and food and cover
    conditions during the year. Wildlife- including migratory birds, upland game birds,
    big game animals, furbearers, predators, rodents, mammals, raptors, reptiles, and
    diseases- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, collections and receipts, vegetation control,
    and wildfires. Resource management is outlined; topics include surplus animals sales.
    A progress report on field investigations and applied research is also provided.
    The public relations section of the report describes recreational uses, Refuge visitors,
    and safety. Items of interest, N-R forms, and photographs are attached. A report
    on the preliminary results of a study of the pronghorn antelope are also included.",nt"owner_org":
